package org.ton.java.tlb;

import lombok.extern.slf4j.Slf4j;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.JUnit4;
import org.ton.java.cell.Cell;
import org.ton.java.cell.CellBuilder;
import org.ton.java.cell.CellSlice;

@Slf4j
@RunWith(JUnit4.class)
// "all bocs are outdated - not having new field in StorageInfo (storage_extra)"

public class TestTlbTransactionReader {
  @Test
  public void testLoadTransaction() {
    Cell c =
        CellBuilder.beginCell()
            .fromBoc(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("transaction {}", transaction);
  }

  @Test
  public void testLoadTransaction2() {
    Cell c =
        CellBuilder.beginCell()
            .fromBoc(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("transaction {}", transaction);
  }

  @Test
  public void testLoadTransactionPrintWithBlock() {
    Cell c =
        CellBuilder.beginCell()
            .fromBoc(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("transaction {}", transaction);
  }

  @Test
  public void testLoadTransactionOutMgs() {
    Cell c =
        CellBuilder.beginCell()
            .fromBocBase64(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("transaction {}", transaction);
    log.info("msg {}", transaction.getInOut().getOutMessages().get(0));
    log.info(transaction.toCell().print());
  }

  @Test
  public void testLoadTransactionPrintNoBlock() {
    Cell c =
        CellBuilder.beginCell()
            .fromBoc(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("transaction {}", transaction);
  }

  @Test
  public void testDeserializeTransaction() {
    Cell c =
        CellBuilder.beginCell()
            .fromBocBase64(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    Transaction transaction = Transaction.deserialize(cs);
    log.info("Transaction {}", transaction);
  }

  @Test
  public void testLoadTransactionDescription() {
    Cell c =
        CellBuilder.beginCell()
            .fromBoc(
                "")
            .endCell();

    CellSlice cs = CellSlice.beginParse(c);
    TransactionDescription transactionDescription = TransactionDescription.deserialize(cs);
    log.info("transactionDescription {}", transactionDescription);
  }
}
